        public void ProcessForm(mshtml.HTMLDocument htmlDoc, String strPageIndex)
        {
            switch (strYA)
            {
                case "2008":
                    ProcessFormM2008(htmlDoc, strPageIndex);
                    break;
                case "2009":
                    ProcessFormM2009(htmlDoc, strPageIndex);
                    break;
                case "2010":
                    ProcessFormM2010(htmlDoc, strPageIndex);
                    break;
                case "2011":
                    ProcessFormM2011(htmlDoc, strPageIndex);
                    break;
                
                //simkh 2012 SU2
                case "2012":
                    ProcessFormM2012(htmlDoc, strPageIndex);
                    break;
                case "2016":
                    ProcessFormM2016(htmlDoc, strPageIndex);
                    break;
                //simkh 2012 SU2

               //simkh end
            }
        }

